import React from 'react'
import { useParams } from 'react-router-dom'
const JobApplicant = ({jobStatus}) => {
    const { id } = useParams()
    return (
        <div>
            {jobStatus.jobs.map(job => {
                return id
            })}
        </div>
    )
}

export default JobApplicant
